      method: "DELETE",
    });
  };

  return (
    <table>
      <tr>
        <td>{repo.title}</td>
        <td>{repo.description}</td>
        <td>{repo.location}</td>
        <td>
          <button onClick={handleDeleteClick}>
            <span className="btn1">
